import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import About from "./About";
import Home from "./Home";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact={true} path='/'>
          <Home />
        </Route>

        <Route exact={true} path='/about'>
          <About />
        </Route>
        </Routes>
    </Router>
  );
}

export default App;
